import styled from "styled-components";
import { PortfolioCard } from "../share-components/Cards/PortfolioCard";
import { CardTitle } from "../share-components/Cards/CardTitle";
import {Calculator} from "../Images/calculator.png";
import {InfoRetrieve} from "../Images/inforetrieve.jpg";
import {SimonSays} from "../Images/simonsay.jpg";
import {TicTacToe} from "../Images/tictactoe.jpg";


function Portfolio(){
    return(
        <Wrapper>

        <ContentWrapper>
            <TitleContainer>
                <CardTitle styling="linear-gradient(0deg, rgba(255,64,3,0) 0%, rgba(255,91,0,1) 70%);" 
                t="4px solid red">
                    Web application
                </CardTitle>
            </TitleContainer>
            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
                <PortfolioCard title="Simon Says"/>
            </CardContainer>
        </ContentWrapper>
        <ContentWrapper>
            <TitleContainer>
                <CardTitle styles="linear-gradient(0deg, rgba(3,209,255,0) 0%, rgba(0,157,255,1) 70%);">
                    Software
                </CardTitle>
            </TitleContainer>
            <CardContainer>
                <PortfolioCard image={InfoRetrieve} title="Information Retrieval" />
                <PortfolioCard image={TicTacToe} title="Tic Tac Toe"/>
                <PortfolioCard image={Calculator} title="Calculator"/>
                <PortfolioCard image={""} title="Risk"/>
            </CardContainer>
        </ContentWrapper>

            {/* <CardTitle>Software application</CardTitle>
            <CardContainer>
                <PortfolioCard title="Password Generator"/>
                <PortfolioCard title="Simon Says"/>
            </CardContainer> */}


        </Wrapper>
    )
}

export {Portfolio}

